import React, { Component } from 'react'
import Components from './Components';

class TemplatePreview extends Component {
    render() {
        const variables = this.props.variables ? this.props.variables : [];
        const shapesList = this.props.shapesList ? this.props.shapesList : [];
        // Array of shapes
        let varsArray = Object.keys(variables);
        let firstShapeIndex = varsArray.indexOf('shapes');
        let shapesArray = varsArray.splice(firstShapeIndex);
        console.log(shapesArray);

        return (
            <div className={`template_preview${variables ? '' : ' hidden'}`}>
                {
                    shapesList.length > 0 && shapesList.map(component => {
                        return component.shapes.length > 0 && component.shapes.map(shape => {
                            return (
                                <Components
                                    key={shape.shape}
                                    component={component.name}
                                    shape={shape.shape}
                                />
                            )
                        })
                    })
                }
            </div>
        )
    }
}

export default TemplatePreview;
